import React from 'react';
import './App.css';
import { AppBar, Toolbar, Container, IconButton, Typography } from '@material-ui/core'
import MenuIcon from '@material-ui/icons/Menu'

function App() {
  return (
    <AppBar position="fixed">
      <Container fixed>
        <Toolbar>
          <IconButton
            color='inherit'
            aria-label='menu'
          >
            <MenuIcon />
          </IconButton>
          <Typography 
            variant='h6'
          >
            Web Developer Blog
          </Typography>
        </Toolbar>
      </Container>

    </AppBar>  
  );
}

export default App;
